import React from "react";

const WorkCard = () => {
  return (
    <div className=" bg-white w-fit rounded-lg ">
      <img
        className=" w-[274px] h-[225px] "
        src="https://netlify-eleventy-api-img.netlify.app/https%3A%2F%2Fcdn.sanity.io%2Fimages%2Fo0o2tn5x%2Fproduction%2Fec5f81e77a5c432492776ebe44b7e2bdddf91e07-1190x1196.png/webp/1190/"
        alt="name"
      />
      <h1> Company Name </h1>
      <p> Company Type </p>
    </div>
  );
};

export default WorkCard;
